		/// <summary>
		/// Override to provide the right mouse action when trying
		/// to create links on the diagram
		/// </summary>
		/// <param name="pointArgs"></param>
		public override void OnViewMouseEnter(DslDiagrams::DiagramPointEventArgs pointArgs)
		{
			if (pointArgs  == null) throw new global::System.ArgumentNullException("pointArgs");
		
			DslDiagrams::DiagramView activeView = this.ActiveDiagramView;
			if(activeView != null)
			{
				DslDiagrams::MouseAction action = null;
				if (SelectedToolboxItemSupportsFilterString(activeView, global::IPS.ANHAMMDRM.ANHAMMDRMLenguaje.ANHAMMDRMLenguajeToolboxHelper.ConectorDerechaFilterString))
				{
					if (this.conectorDerechaConnectAction == null)
					{
						this.conectorDerechaConnectAction = new global::IPS.ANHAMMDRM.ANHAMMDRMLenguaje.ConectorDerechaConnectAction(this);
						this.conectorDerechaConnectAction.MouseActionDeactivated += new DslDiagrams::MouseAction.MouseActionDeactivatedEventHandler(OnConnectActionDeactivated);
					}
					action = this.conectorDerechaConnectAction;
				} 
				else if (SelectedToolboxItemSupportsFilterString(activeView, global::IPS.ANHAMMDRM.ANHAMMDRMLenguaje.ANHAMMDRMLenguajeToolboxHelper.ConectorIzquierdaFilterString))
				{
					if (this.conectorIzquierdaConnectAction == null)
